(38, '2015-04-08 07:46:45', '2015-04-08 08:41:50', 'Hi,\r\n\r\nPhilip here! Welcome to Founders Market. I see you are looking to join someone? I am looking for someone who is fluent in Java and PHP?\r\n\r\nLet me know if you would be interested in chatting further!\r\n\r\nEnjoy Founders Market!', 'read', 74, 38),
(39, '2015-04-08 07:50:30', '2015-04-08 07:50:30', 'Hi Tyron,\r\n\r\nPhilip here man! Interesting bio. Well done on your work thus far!\r\nAre you South African by any chance? that is definitely not an Irish surname anyway.\r\n\r\nI am interested in learning about Rubix, what is Rubix?\r\n\r\nTake care man, enjoy Founders Market! ', 'unread', 59, 38),
(40, '2015-04-09 07:54:07', '2015-04-09 23:23:12', 'Hey Philip! I am actually currently still in college, so I can''t really fully commit to much at the moment. Also, I don''t know if I am as fluent as you would be looking for. It does sound interesting though, can I ask what sort of thing it is you''re doing? ', 'read', 38, 74),
(41, '2015-04-09 23:27:58', '2015-04-11 09:57:11', 'Great Fionn. We are looking for developers to join the Founders Market team. The only catch is, we are looking for people who really know their way with Java and PHP. I am also aware of other people who have some really exciting projects and they are looking for technical co-founders. Yeah man, I am in College myself studying law, but I refuse to let school ruin my education. ;) ', 'read', 74, 38),
(42, '2015-04-11 10:12:24', '2015-04-11 18:56:58', 'Well I am pretty confident in my knowledge of both languages to a certain extent (Java moreso than PHP) but I''ve never been faced with anything too troubling yet in them!  I would say if you''re looking for someone to head the technical backend of something, I''d say you''d have more luck with someone more experienced! I would be willing to  see if I am able to do what you guys need though. \r\nAs for college, I just mean that for the next few weeks I will be studying for exams, etc!', 'read', 38, 74),
(43, '2015-04-11 18:58:36', '2015-04-12 06:31:14', 'I understand (about college), in the same boat. Have you worked on anything before?', 'read', 74, 38),
(44, '2015-04-12 17:19:16', '2015-04-13 18:47:06', 'I''ve never worked on anything more than just standalone programs for college, etc. Nothing too big..  I am ready and eager to learn about a way to put my knowledge into real practice though.', 'read', 38, 74),
(45, '2015-04-13 18:47:41', '2015-04-15 08:28:15', 'Great Fionn! So please can we set a coffee date to discuss things further?', 'read', 74, 38),
(46, '2015-04-15 08:50:36', '2015-04-15 12:51:38', 'Yeah sure, I''m busy all this Friday and possibly Saturday morning but apart from that, I''m mostly free!', 'read', 38, 74),
(47, '2015-04-22 06:54:47', '2015-04-22 08:47:07', 'I am busy all of this week and the next, I will drop you an inbox late next week.', 'read', 74, 38),
(48, '2015-04-22 08:48:30', '2015-04-23 08:38:15', 'Yeah I''ll be pretty caught up in the study too. Okay, thanks Philip! Looking forward to it', 'read', 38, 74),
(49, '2015-04-23 13:25:12', '2015-04-24 06:59:54', 'Hey Kevin,\r\n\r\nHow are you after the startup weekend? :) It was a great weekend for me but my god is there a come down after them! haha \r\n\r\nAnyway I signed up for this as I will be helping Phil with a few things on the project. But I came across your profile and was intrigued. \r\n\r\nIm working on a project at the moment called MusicMonkey. It fits what you are looking for in that it is a hardware and software solution. I started the company with my old boss from Monster Cable in San Francisco and we are looking for someone with experience in hardware and software. \r\n\r\nWe are almost finished our prototype which is built on a raspberry pi and an Android app. \r\n\r\nOur hardware devices connects to a bluetooth speaker, or any stereo system really. We have a spotify account running on the raspberry pi. Users then with the app get to see the music thats played, whats coming next, add their own music, vote on songs on the playlist to get them played sooner. \r\n\r\nIt would be great to chat with you about the project and see what you think. I really appreciated the work you guys did and this seems like your area of expertise! \r\n\r\nLet me know if you wanna meet up for a coffee or a pint and we can take it from there! \r\n\r\nWill ', 'read', 35, 91),
(50, '2015-04-24 07:28:47', '2015-04-24 12:53:40', 'Hey Will,\r\n\r\nI''m good! I was exhausted after it because it threw off my normal food/coffee routine completely but  back into the swing of things now for exams. :)\r\n\r\nSounds like an interesting project! I''d be happy to meet up for a coffee to have a chat about the project and help in any way I can. \r\n\r\nI''ll be in exam mode until May 6th and I''ll be on campus working on some other projects for a few weeks afterwards, so any day after the 6th that suits you (apart from May 12th) will work for me.\r\n\r\nCheers, Kevin.\r\n', 'read', 91, 35),
(51, '2015-04-24 14:10:39', '2015-05-07 06:30:14', 'Sounds good man! Best of luck with the exams, didnt realise that they were starting so soon, I thought it was starting in May! \r\nMy number is 087-2746341, if you wanna send me a text or whatsapp we can plan to co-ordinate a time. Phil is actually running a founders market event on the 7th that I will be MCing so maybe we could meet up for a coffee before that? Should be a good event with someone pitching and then people in the audience giving feedback/advice and asking questions on the company etc. ', 'read', 35, 91),
(52, '2015-05-07 06:33:59', '2015-05-07 15:48:45', 'Hey Will, Sorry for radio silence, needed to get the head down to finish everything off! I won''t be able to make it in for the event this evening, I''ve a lot of things to sort out after dropping everything for the exams. Would Monday suit you at all?', 'read', 91, 35),
(53, '2015-05-07 22:10:26', '2015-05-08 12:02:53', 'Hi Philip, \r\n\r\n Great to meet up tonight, thanks for your pitch. I''ll be back on here in the next few days, looks like it has great potential.\r\n\r\nPatrick', 'read', 38, 95),
(54, '2015-05-08 12:04:19', '2015-05-08 12:04:19', 'Hi Patrick, Thanks for reaching out! Great to meet you! Looking forward to reading up on your profile. Thanks for the faith in the platform, we are going to be doing some major development on the site over the next few weeks. Bound to be made better!', 'unread', 95, 38),
(55, '2015-05-08 12:21:51', '2015-05-09 07:02:23', 'Hi Fionn,\r\n\r\nHope exams have gone well.', 'read', 74, 38),
(56, '2015-05-09 09:56:54', '2015-05-11 11:38:20', 'Hey Philip, yeah I feel pretty confident on most! We''ll find out in a few weeks. Were you doing exams?  ', 'read', 38, 74),
(57, '2015-05-11 11:38:47', '2015-05-11 21:25:19', 'Yeah, I was Fionn. Goodluck. When can we meet?\r\n', 'read', 74, 38),
(58, '2015-05-12 10:01:44', '2015-05-12 10:01:44', 'Hey Kevin, only just getting this no so apologies for not getting back to you in time. Im about this week so let me know when suits you! I hope all the exams and projects went well! ', 'unread', 35, 91),
(59, '2015-05-12 10:02:53', '2015-05-12 10:02:53', 'Hey Joe, fancy meeting you here! \r\n\r\nHow are things with you? What are you working on these days? ', 'unread', 44, 91),
(60, '2015-05-12 10:07:35', '2015-05-12 10:16:44', 'Hi Eytan,\r\n\r\nHow are you ? I am working with some developers in Vietnam so was intrigued when I saw your profile. Are you currently based there? I am considering moving there to escape Ireland, work side by side with my developers and enjoy life to a higher standard while on minimum salary while starting up my own projects. \r\n\r\nI have a background in Financial Economics and Computer Science and am currently working on LiveDuel which builds games around sports. So obviously I am quite intrigued by your plan of a game to teach financial literacy to the millennial market of Asia. \r\n\r\nIt would be good to chat a bit more. ', 'read', 97, 91),
(61, '2015-05-12 10:26:05', '2015-05-12 10:37:26', 'Hi Will.\r\nAwesome stuff! Would be great to engage with other worldly enthusiastic individuals.\r\nI myself have been working on a few projects here but it is a bit hard to find like-minded people  in Vietnam for various groups reasons. \r\nBtw. Have you ever visited Vietnam before? The people you are engaged with, are they in Ho Chi Minh Cityi (Saigon) or Hanoi?s\r\nCheers.', 'read', 91, 97),
(62, '2015-05-12 10:42:03', '2015-05-12 11:33:41', 'I have never visited there but I lived in Taiwan for 6 months while I was doing my masters in entrepreneurship, so I kind of understand what you mean when you say its hard to find like-minded people. The cultural and language barrier problems are maximised when you are talking about big new ideas. \r\n\r\nThey are actually based in Da Naag, which is the third city I believe. I have done a bit of research on it and it seems like it is a great city for developers, good surf scene with a lot of nice beaches. And with it being the third city I imagine the cost of living is more manageable? I have also heard that the larger cities that you mentioned are having issues with old infrastructure. It would be great to hear some of your insight. \r\n\r\nWhere are you based? What are your thoughts on Vietnam as a startup country? Is it easy to move there and setup shop as a foreign company? ', 'read', 97, 91),
(63, '2015-05-12 11:19:32', '2015-05-12 11:19:32', 'Hope they went well!  Well I won''t be around for the weekend starting Thursday maybe, so we could meet either tomorrow sometime or anytime next week!', 'unread', 38, 74);
