INSERT INTO `news_items` (`id`, `created_at`, `updated_at`, `title`, `excerpt`, `url`, `author`, `sponsored`, `image`) VALUES
(4, '2015-03-22 12:08:21', '2015-03-22 12:08:21', '5 Weekend Habits of Successful Entrepreneurs', 'Successful entrepreneurs know that good habits don’t start on Monday and end on Friday. Entrepreneurs expect to work longer hours than anyone else, but they also know that they have to fuel that success. While researching to compare my weekend habits to those of other successful entrepreneurs, I found this LifeHack article that teaches many extremely valuable habits, some of which I already noticed in my own routine.', 'http://www.entrepreneur.com/article/242874', 'Timothy Sykes', 'no', '/images/news-items/aadc71de35e82c9d7f5ce1d4ce6ebdcc2fe7c0fc.jpeg'),
(5, '2015-03-22 12:15:19', '2015-03-22 12:15:19', '5 Things You Should be Doing to Have an Insanely Productive Week', 'A productive week depends largely on what you focus on every working day and how much time you allocate to activities that take up your time (i.e. busy work). Working harder does not necessarily mean you are being productive. There will always be a better way to complete that task. Find it, work smarter and get more done in your working week. These are a few things can do to have an insanely productive week this and every other week.', 'http://www.entrepreneur.com/article/237985', 'Thomas Oppong', 'no', '/images/news-items/5812e8cc163a24b5da964d5df459b10d73d41677.jpg'),
(6, '2015-03-22 12:18:35', '2015-03-22 12:18:35', 'Habits of the World''s Wealthiest People (Infographic)', 'What do Oprah Winfrey and Warren Buffett have in common, in addition to their fairly sizable net worths? More than you might think.', 'http://www.entrepreneur.com/article/230918', 'Nina Zipkin', 'no', '/images/news-items/219048b01d93afc3c6983f7312efab6793aedf4c.jpg'),
(7, '2015-03-22 12:22:42', '2015-03-22 12:22:42', '7 Insanely Productive Habits of Successfull Young Entrepreneurs', 'Entrepreneurship isn''t for the faint at heart. Founders must forge their own path, gather resources and take on huge financial risks – all in the hopes of avoiding the fate that 80 to 90 percent of startups suffer: failure. So to be successful, entrepreneurs really have beaten the odds – especially young entrepreneurs. Starting with almost no wealth, network or business experience, many create more success in a few years than most people do in their entire lifetime.', 'http://www.entrepreneur.com/article/238847', 'Michael Simmons', 'no', '/images/news-items/679893b25e87e8707499b26eabb2b5a91b663e7d.jpg'),
(8, '2015-03-22 12:25:37', '2015-03-22 12:25:37', '5 Things To Do Before Bed That Will Jump Start Tomorrow', 'Being effective as an entrepreneur is often about hard work, but even more importantly it’s about smart work. Great entrepreneurs know that time is limited and valuable, so they need to make the most of each waking hour. There are many factors that contribute to working smart -- but planning and proper sleep are among the top performance increasers.', 'http://www.entrepreneur.com/article/234622', 'Matthew Toren', 'no', '/images/news-items/3387bc388b3d1c1eecb469e6013ffac0b0eacaec.jpg'),
(9, '2015-03-22 12:29:48', '2015-03-22 12:29:48', '5 Morning Rituals to Keep You Productive All Day Long', 'Most of us work long hours: 40, 50 or even 60 hours each week. But chances are, given distractions like online entertainment, office snacking habits and ill-designed time management, we''re only churning out high-quality work a portion of each day. Here are five practical steps to incorporate into any morning routine to optimize your time at the office and maintain productivity all day long.', 'http://www.entrepreneur.com/article/230734', 'James Reinhart', 'no', '/images/news-items/b04a3b38f9727ba0a4d9a872829696e304f0ae15.jpg'),
(10, '2015-03-22 12:33:48', '2015-03-22 12:33:48', 'Think You''re Too Old to Be An Entrepreneur? Think Again. (Infographic)', 'If Hollywood wants to portray an entrepreneur in a movie, then he - and it’s usually a he – is in his early 20s, may or may not have a college degree, is probably wearing blue jeans and a hoodie, and is a bit unkempt, with messy hair and facial hair. That stereotype may appeal to our interest in a narrative where geeks take over the world, but the Mark Zuckerberg-inspired vision is absolutely only a part of the entrepreneurship story. Many entrepreneurs don’t even think about launching their own business until they are in their 30s, 40s, and even 50s, after years of work experience.', 'http://www.entrepreneur.com/article/232707', 'Catherine Clifford', 'no', '/images/news-items/d0f8708e9e8e8668102e63be4bf6574e17d0b215.jpg'),
(11, '2015-03-22 12:38:48', '2015-03-22 12:38:48', 'How to Become a Millionaire by Age 30', 'Getting rich and becoming a millionaire is a taboo topic. Saying it can be done by the age of 30 seems like a fantasy. It shouldn’t be taboo and it is possible. At the age of 21, I got out of college, broke and in debt, and by the time I was 30, I was a millionaire.', 'http://www.entrepreneur.com/article/234454', 'Grant Cardone', 'no', '/images/news-items/994b2b623a5c8853e029b5507baf7aacc2549a28.jpg'),
(12, '2015-03-22 12:41:25', '2015-03-22 12:41:25', 'Why Google doesn’t care about college degrees, in 5 quotes', 'Google isn’t big on college degrees, although the search giant is inundated with applicants touting perfect GPAs from Ivy League schools. Google’s chairman and head of hiring, Laszlo Bock, has given a few insights in the New York Times on how he sorts through a multitude of bright applicants. The upshot is that Google values the skills and experiences that candidates get in college, but a degree doesn’t tell them much about talent or grit.', 'http://venturebeat.com/2014/04/25/why-google-doesnt-care-about-college-degrees-in-5-quotes/', 'Gregory Ferenstein', 'no', '/images/news-items/572c0981a028368067242fb8a594b8d60ac51d5e.jpg'),
(13, '2015-03-22 12:44:34', '2015-03-22 12:44:34', 'How quitting my corporate job for my startup dream f*cked my life up', 'In this story, Ali Mese reveals the unexpected difficulties that come with abandoning the corporate world for the startup dream. You may have planned on financial burdens, but have you considered the social distancing? The anxious parents? The frustrated fiancé? Mese reminds us that entrepreneurship isn''t all sunshine and puppies.', 'https://medium.com/everything-about-startups-and-entrepreneurship/how-quitting-my-corporate-job-for-my-startup-dream-f-cked-my-life-up-3b6b3e29b318', 'Ali Mese', 'no', '/images/news-items/6fc993446c9b8fb814b3b7938014e78867c3b363.jpeg'),
(14, '2015-03-24 16:36:08', '2015-03-24 16:36:08', 'Why Entrepreneurs Must Research Market Size', 'Reasonably and thoughtfully estimating an idea''s potential market size is a key step to successfully bringing an idea to market. When seeking out potential licensors or investors, you can bet they’ll consider market size to judge the revenue generating potential of a new idea.', 'http://www.entrepreneur.com/article/243498', 'Louis Foreman', 'no', '/images/news-items/38e04761822ee5badaa8b019fe8a6d19d8c7af04.jpeg'),
(15, '2015-03-24 16:40:21', '2015-03-24 16:40:21', '3 Steps to the Perfect 3-Minute Pitch', 'Even if you aren’t looking for sponsors, the challenge remains the same. When startups attend pitch days in front of prospective investors, there is a formulaic approach to the ask. While you may not need to adhere to a script for a slide deck, a solid three-minute pitch can help you attract vendors and suppliers, woo landlords and advertisers, recruit employees, and win over other advocates. And, yes, maybe even investors someday (at which point you’ll revisit that pitch deck). \r\nFollow these three basic principles to frame your pitch and easily adapt it in the moment. ', 'http://www.entrepreneur.com/article/242523', 'Joanne Cleaver', 'no', '/images/news-items/31b479c7ad2d85e9437f388c574cff91b169f188.png'),
(16, '2015-03-24 16:45:35', '2015-03-24 16:45:35', 'Success vs. Happiness: Don''t Be Fooled Into Thinking They''re the Same', 'Take a minute to think about how "successful" you are.\r\nNow think about what criteria you used to evaluate yourself. Some people might look to their bank account. Others to various degrees they''ve collected. Many would look to their relationships with a spouse, their children, their friends. Some might even open their closet and look to their collection of designer shoes, bags and watches.', 'http://www.entrepreneur.com/article/243605', 'Sarah Vermunt', 'no', '/images/news-items/35f4431a91603675dafd9220d4ae630201be0706.jpeg'),
(17, '2015-03-24 16:56:29', '2015-03-24 16:56:29', '23 Things Every Entrepreneur Must Know', 'A buddy of mine is a big-deal business professor at an even bigger deal university.  And for reasons I still don’t understand, he asked me to come in and explain to his graduate students what I have learned from spending 30 years talking to, researching and writing about entrepreneurs. Here’s what I said.', 'http://www.forbes.com/sites/actiontrumpseverything/2013/09/22/23-things-every-entrepreneur-must-know-2/', 'Paul Brown', 'no', '/images/news-items/05ba48f57acddf121fb0dd43e1acf482eb2c9b26.jpg'),
(18, '2015-03-24 17:06:12', '2015-03-24 17:06:12', '24 Must-Read Blogs For Entrepreneurs', 'Starting a company is hard, so you''re going to need a lot of advice along the way.\r\nThere are many entrepreneurs, investors and bloggers who churn out business advice daily, but it''s a pain figuring out which sites are worth reading.\r\nWe''ve compiled a list of our favourite sources of small business and tech news for entrepreneurs.', 'http://www.businessinsider.com/24-must-read-blogs-for-entrepreneurs-2012-6?op=1&IR=T', 'Fred Wilson', 'no', '/images/news-items/060dec8466af71493656b8d7c2349719d09bd28c.png'),
(19, '2015-04-01 12:23:58', '2015-04-01 12:23:58', 'In Business, Nice Guys Finish First. Yes, Really.', 'Leaders who display four cardinal virtues — integrity, compassion, the ability to forgive and forget, and accountability — consistently deliver return on assets up to five times larger than the ROAs produced by their counterparts with a “self-focused” leadership style, who never or rarely exhibit those four traits. ', 'http://www.entrepreneur.com/article/244578', 'Anne Fisher', 'no', '/images/news-items/955d7eb1a9723336cb6bd2e0d829493ce9f51b75.jpg'),
(20, '2015-04-01 12:27:11', '2015-04-01 12:27:11', 'Becoming a Great Leader Starts With Building Trust', 'Think about the areas in your life that generate the most passion and commitment from you. For me, it’s the belief that I create my own success. I believe it so wholeheartedly that I never accept an excuse or victim mindset from myself, my kids or my employees. This belief is tied to my own experiences, and I have personal stories to support it. I can’t expect my team to buy into this concept if I don’t believe it for myself.', 'http://www.entrepreneur.com/article/244367', 'Jason Forrest', 'no', '/images/news-items/31e23dbe5ee3de0c9eaa22406b892e2dffb22af7.jpg'),
(21, '2015-04-01 12:30:19', '2015-04-01 12:30:19', 'How Office Politics Can Tank Your Small Company', 'Workplace conflict can creep into every aspect of a business – especially small and new businesses. When you’re trying to grow your company, you cannot afford the time or the money it takes to deal with internal conflicts.', 'http://www.entrepreneur.com/article/243983', 'Beth Miller', 'no', '/images/news-items/3f276fc4a9e43748b6c1b196077fe9266107727b.jpg'),
(22, '2015-04-01 12:33:09', '2015-04-01 12:33:09', 'The 4 Things You Need to Reach Customers on Facebook', 'When it comes to Facebook, some people talk about metrics, such as the perfect time to post, the perfect length of a post, or the perfect way to post a link. But none of that matters as much as posting content that your audience cares about. Yes, there are strategies that work better on Facebook in terms of getting more visibility, but when you focus on providing good content consistently, your audience will make sure they go out of their way to find you.', 'http://www.entrepreneur.com/article/243028', 'Mitch Meyerson', 'no', '/images/news-items/29dbe9a66ccb085a0c370078f25fcaaf95d80ffb.jpg'),
(23, '2015-04-01 12:38:05', '2015-04-01 12:38:05', 'How to Design the Perfect Logo (Infographic)', 'Logos are the face of your company, the deliverers of the all-important lasting impression, crucial visual representations of your business, what you do and what you’re about. Accordingly, the utmost care and meticulousness should be taken when designing yours. If you already have a logo, the same goes for redesigning it. Spare no attention to detail.', 'http://www.entrepreneur.com/article/244546', 'Kim Lachance Shandrow', 'no', '/images/news-items/d1832784636a043289e59d98021737290eede92f.jpg'),
(24, '2015-04-01 12:43:39', '2015-04-01 12:43:39', 'iOS or Android for my startup?', 'You’re thinking about making your first mobile application for your startup. That’s awesome. You’re about to face though arguably one of the biggest questions and obstacles in your young startup life — should you focus on iOS or Android first?', 'http://chopdawg.com/ios-android-startup/', 'Joshua Davidson', 'no', '/images/news-items/d5fe10d563acd63b0f2a4a5c788a50e64d5cd943.jpg'),
(25, '2015-04-01 13:41:46', '2015-04-01 13:41:46', 'Founders Market at the Student Summit 2015', 'The Founders Market team will be at the student summit (www.studentsummit.ie) in April. \r\nThe student summit is a perfect compliment to what Founders Market stands for - encouraging student entrepreneurship in the world. \r\n\r\n"We are very excited. For us at the office, everyday is an opportunity to empower another student entrepreneurs!" - Evan Smith, Co-founder and CTO', 'http://studentsummit.ie/blog/foundersmarket', 'Founders Market', 'yes', '/images/news-items/50a7e772c020d92e22554dee6c17481d8ee99d41.jpg'),
(26, '2015-04-01 16:00:17', '2015-04-01 16:00:17', 'Hiring Your First Employee', 'One of the biggest things is understanding right away when it is the right time to hire your first team member. For many new entrepreneurs (including myself at the time), this is the hardest thing out of everything I am about to document. You often fool yourself into thinking you need more help in order to maximize efficiency (and profits). This is usually false. I truthfully believe that you should only hire your first team member when the following criteria have been met...', 'http://chopdawg.com/hiring-first-employee/', 'Joshua Davidson', 'no', '/images/news-items/851afc244fcbfd214f0a60b46955772b8daf0c5b.jpg'),
(27, '2015-04-01 16:04:09', '2015-04-01 16:04:09', 'Start Your New Week Off Right', 'Everyone always rejoices when it comes to Friday. It’s the end of the business week; meaning the next 48+ hours are yours for the taking. As an entrepreneur though, we don’t have off hours or downtime. We’re on the clock, every minute of every single day. For some reason though, some of us feel that this isn’t the case and pretend the weekend is a time where business doesn’t exist, your job description of running a company disappears and all of your responsibilities vanish into thin air.', 'http://chopdawg.com/start-your-new-week-off-right/', 'Joshua Davidson', 'no', '/images/news-items/3aa53194f4cb0d013f5cdbb9062438a3ec2400f9.jpg'),
(28, '2015-04-01 16:17:24', '2015-04-01 16:17:24', 'Lessons of Successful Entrepreneurs', 'Successful businessmen told a roomful of students that ultimately, the world outside the classroom will be their best teacher in entrepreneurship.', 'http://hbswk.hbs.edu/item/4704.html', 'Sean Silverthorne', 'no', '/images/news-items/b8981d13cd87049e833f36fcd7ec1450279ab637.jpg'),
(29, '2015-04-01 16:26:09', '2015-04-01 16:26:09', 'How an Entrepreneur''s Passion Can Destroy a Startup', 'Call it the paradox of entrepreneurship: The very thing it takes to start a business often ends up destroying it.\r\nI''ve spent the past 15 years researching people who start companies, and there''s a consistent theme among the 16,000 founders I''ve analyzed. It''s passion. Founders believe in their ideas so strongly they throw aside comfortable jobs and risk their life savings to chase their dreams. They have such contagious enthusiasm they can convince others to sign on, whether it''s co-founders or venture investors or early-adopting customers.\r\nStrong Feelings Can Lead Founders to Make Bad Choices at the Worst Times. Here''s What to Watch For.', 'http://www.wsj.com/articles/how-an-entrepreneur-s-passion-can-destroy-a-startup-1408912044', 'Stephen Webster', 'no', '/images/news-items/652d5dd0d38a5c09192369e2f1eaaac8c7f81c73.jpg'),
(30, '2015-04-01 16:30:47', '2015-04-01 16:30:47', 'Incredible Productivity Advice Given By 21 Successful Young Entrepreneurs', 'If you want to be a successful entrepreneur (or successful at anything) you have to know how to get stuff done. These 21 successful young entrepreneurs shared their best productivity advice.', 'http://www.lifehack.org/articles/productivity/incredible-productivity-advice-given-21-successful-young-entrepreneurs.html', 'Jeff Steinmann', 'no', '/images/news-items/8ae92754659e5bd6f64e180532540dce9a71b8a0.jpg'),
(31, '2015-04-01 17:21:09', '2015-04-01 17:21:09', '10 Traits That Young Millionaires Have in Common', 'The world’s idea of who and what a millionaire is has changed. When we conjure up an image of a very wealthy person, we are imagining less and less a stodgy old man sipping branding in a wing back armchair, and instead, more and more what we envision is a young, energetic entrepreneur.  The internet has paved the way for anyone with a good idea and the ambition to see it through to become rich and it is increasingly common for the successful people among us to be young and driven. So what do the young millionaires we are getting so used to seeing have in common? They all share the following 10 traits.', 'http://www.lifehack.org/articles/productivity/10-traits-that-young-millionaires-have-common.html', 'Steve Kux', 'no', '/images/news-items/9e12c33a9b896008785e0ad71bc30415707b7a18.jpg'),
(32, '2015-04-01 17:26:05', '2015-04-01 17:26:05', 'Entrepreneurs Are Not Normal', 'freak |freek| noun: a person who is obsessed with or unusually enthusiastic about a specified interest.\r\nIf that’s not a definition for an entrepreneur, I don’t know what is. No doubt you have to be “unusually enthusiastic” and pretty freaky to get on this roller coaster. Most don’t have the courage to even step into the car of this thrill ride. But you do, and that is exactly why they will call you a freak.', 'http://www.success.com/article/entrepreneurs-are-not-normal', 'Darren Hardy', 'no', '/images/news-items/121150f47a9af3f3f5a62c147f379959bf49f170.jpg'),
(33, '2015-04-01 17:30:01', '2015-04-01 17:30:01', '15 Twitter Accounts Every Entrepreneur Should Follow in 2015', 'Twitter is a great place to follow breaking news, learn about trending topics, and participate in conversations about practically anything. It''s also a veritable trove of information for entrepreneurs and small business owners. If your business strategy could use some help in the New Year, or if you just want some bite-size pieces of startup advice, check out these 15 Twitter accounts about entrepreneurship.', 'http://www.businessnewsdaily.com/7527-entrepreneur-twitter-accounts.html', 'Nicole Fallon', 'no', '/images/news-items/761f6f44c50d06d1ddc6112769551d19468dc342.jpg'),
(34, '2015-04-01 19:33:49', '2015-04-01 19:33:49', 'Ireland’s Student Startup Weekend returns to UCC', 'It has been announced today that Ireland''s Student Startup Weekend will be returning to UCC from Friday 10th to Sunday 12th April.\r\nDuring the event, students will converge at UCC’s Western Gateway Building for weekend long workshops where they will pitch business ideas, form teams, and start companies. The event aims to bring together the highest calibre young entrepreneurs from all over Ireland, the UK and further afield. ', 'https://www.businessworld.ie/news/Ireland-s-Student-Startup-Weekend-returns-to-UCC-28644.html', 'Robert McHugh', 'no', '/images/news-items/516b1b661182c714fe013c7309ad5ed0838fff70.jpg'),
(35, '2015-04-12 15:52:54', '2015-04-12 15:52:54', 'College Entrepreneurs: How to Make the Most of Your Education When Starting a Business', 'Are you in college and contemplating whether to start a business?\r\nMany young entrepreneurs ask themselves this question: Should I finish school or start my business?\r\nDeciding to start a business while in school can pose quite a dilemma, but there’s good news: It doesn’t have to be one or the other. In fact, staying in school can actually give you the tools you need to get your startup off the ground.\r\nHere’s how to get the best of both worlds by leveraging resources at a college or university and starting a business.', 'http://yfsmagazine.com/2013/04/03/10-must-read-articles-on-college-entrepreneurship-and-student-led-startups/', 'YFS Small Business Contributors', 'no', '/images/news-items/df8e64169862c351516e67da1324f2217f788b9a.jpg'),
(36, '2015-04-12 15:59:48', '2015-04-12 15:59:48', 'Here’s $100k: Drop Out of College, Start a Business and Change the World', 'What would you do if someone handed you a check for $100,000 dollars? But here’s the catch: Drop out of college, start a business and get ready to solve some of the world’s biggest problems. Are you up for the challenge? Twenty-four of the world’s brightest minds thought so.', 'http://yfsmagazine.com//2011/05/26/here%E2%80%99s-100k-drop-out-start-a-business-and-change-the-world/', 'Erica Nicole', 'no', '/images/news-items/795a4a279b1a415135bc6ef1cef4f905c12bd04c.jpg'),
(37, '2015-04-12 16:02:24', '2015-04-12 16:02:24', 'College Startups: How One Business Connection Changed Everything', 'Both Jake and Kevin eventually transitioned from paid college projects to projects for celebrity clientele. The young twenty-something entrepreneurs quickly learned the ropes of running a successful company and landing celebrity clients including Cee Lo Green — singer-songwriter, rapper, and record producer — all while balancing college life and graduation.\r\nToday, their startup has come a long way – and the co-founders are producing tours and events for clients ranging from Dolly Parton to Charity Water. Learn how Jake and Kevin built a successful business from their college dorm room and why one connection changed their business forever.', 'http://yfsmagazine.com/2012/03/28/college-startups-how-one-business-connection-changed-everything/', 'YFS Small Business Contributors', 'no', '/images/news-items/6b398b8e18405cee057cdfb14d2633a44b5bae18.jpg'),
(38, '2015-04-12 16:08:06', '2015-04-12 16:08:06', '6 Super Startup Ideas for College Students', 'It’s no secret that today’s college graduates struggle with joblessness and underemployment in record numbers. And with the price index for college tuition climbing almost 80% in the last 10 years, many of these grads find themselves crippled by loan payments as well. \r\nTo help ease the burden, a number of college students are opting to launch their own startups while still in school. Not only does starting a business limit debt liability, but it also allows students to benefit from practical business experience as well as the insight and support of their college professors, all while taking advantage of marketing opportunities that come with living on a college campus.\r\nHere are five super startup ideas for college students looking to make ends meet.', 'http://quickbooks.intuit.com/r/business-planning/6-super-startup-ideas-for-college-students', 'April Maguire', 'no', '/images/news-items/16a1907305561fbc5d34fd193e7883826dc181d8.jpg'),
(39, '2015-04-12 16:11:07', '2015-04-12 16:12:21', 'What 16 Great Startups College Students Are Working On Right Now ', 'Incredibly high profile successes by young founders like Mark Zuckerberg have made founding a startup an increasingly attractive career path for college kids.\r\nSchools know it, and more and more of them are creating accelerators, competitions, and classes designed to get student ideas off the ground.\r\nAs a result, students aren''t waiting to graduate to get started, they''re using their connections at school and the support they''re getting to create fascinating startups. We''ve collected 16 of our favorites.\r\nThese aren''t just another set of apps. Some of these students found business prospects in the most unlikely of places, like a roll of toilet paper. And others, like Gabrielle Palermo, started college with the idea of becoming a doctor but figured out a way to convert her dream of helping people into a business of potentially global proportions.\r\n\r\n', 'http://www.businessinsider.com/best-college-startups-2013-2?op=1&IR=T', 'Marian Simoes', 'no', '/images/news-items/86f9ddafebf83443e91d41de606f12b93a5d7613.jpg'),
(40, '2015-05-08 12:08:03', '2015-05-08 12:08:03', ' 2 min read 6 Steps to Becoming a Successful Student Entrepreneur (Infographic)', 'Bill Gates. Mark Zuckerberg. Larry Page. Sergey Brin. They share more than a few enviable accomplishments. They’re billionaires, they made their fortunes in tech and they started their businesses while they were still students. It also doesn’t hurt that they’re seriously smart cookies.\r\nHowever you slice it, they’re all living proof that you don’t have to wait until after graduation to launch your own business. And, as is the case for Gates and Zuckerberg, you might not have to graduate at all (though, to be clear, we’re not advocating for dropping out).  ', 'http://www.entrepreneur.com/article/245880', 'Kim Lachance Shandrow', 'no', '/images/news-items/c349a800b242c5ea089f6ec188fbe51793929ea9.jpeg');
