(38, '2015-03-07 18:40:37', '2015-05-08 12:22:01', 'philipmngadi@gmail.com', 'philipmngadi', 'Philip', 'Mngadi', 'V8CXpwNCOmuovJxJfRjQCQvZ3O6iAMcEd9FAZOtF4M9VkqwpyRJsZdvMhzk5', '$2y$10$QvIXiDkgL5XWVq40S3sXfeB0EneYjQXBDHfQDChJnI/ccsVxc20Fy', 'Hi, thanks for visiting my profile.\r\n\r\nPhilip was born in the most beautiful South Africa and was raised in the rough and tough areas of Durban city (Look, it''s a beautiful place but crime is not a joke back home. I am loving the Emerald Isle). \r\n\r\nPhilip is an undergraduate Law student at the University College Cork. He currently works part time as a salesman for Crystal Eagle Marketing (Door-to-door sales, events and business-to-business). Here, Philip has developed great confidence, sales techniques and people skills that you can only get from the experience of being out in the door-to-door field. \r\n\r\nPhilip is the Founder and CEO of Talenthub (www.talenthubapp.com) and the Co-Founder and CEO of Founders Market. Philip also has other exciting side projects lined up where he is looking to work with creative web designers and software developers who know their way with Android and iOS.\r\n\r\n"I started this" - Noah Glass, the forgotten Twitter Founder', 'Hi again!\r\n\r\nSo, as I have mentioned in my past experiences, I am always looking for creative web designers and software developers who know their way with Android and iOS. I have a few other projects, besides Talenthub and Founders Market, that I would like to pursue and so I am currently building teams for these projects. Please do message me if you are interested.\r\n\r\nI am always willing to assist anyone with anything you might need help with, as long as I can be useful (please see my skills set above).\r\n\r\n"Good artists copy, great artists steal" - Steve Jobs, the greatest technology artist', 9),
