(57, '2015-04-04 15:19:24', '2015-04-23 11:54:36', 'kinselro@tcd.ie', 'Ross', 'Ross', 'Kinsella', '661mVQ3yHNRw71xE7Aa8zPi6aHMATLFzHqWZD7dqwxGOjsI8Otxtedbg7Pjr', '$2y$10$cWG9gWctOkdBrxA4Oew9Z.9/X/KuFeeEbCmcGlcM6jHGiHJjSlQIi', '# public\r\nwww.joinhive.io\r\nwww.color-book.rosskinsella.ie\r\nwww.baffle.co\r\n\r\n# private\r\nVarious - Rails contracting\r\nITG - Business Intelligence\r\nOrangeTribes - Engineer\r\n\r\n# soon\r\nHubSpot - Engineer\r\nSpaceCow Games - Founder. Debut title to be announced this winter.', 'The person with the next B2B big dirty.\r\n\r\nNot interested in consumer apps.\r\n\r\nGet in touch regarding contracting work.', 9),
(58, '2015-04-04 17:02:50', '2015-04-05 08:19:57', 'jelo.salomon@dit.ie', 'jjsalomon', 'Jelo', 'Salomon', NULL, '$2y$10$eFkIdQYpu23RAwSOCQp0B.5vHd4lPPHK3FxU.KOBbUQ/KShlpbpIy', 'Most of my experience has been consulting different people about their own businesses and how they could gain traffic through inbound strategies.', 'Jelo is looking for small companies who are looking to gain traffic through their website to increase their sales and connect with like-minded individuals.\r\n\r\nHe is also looking to connect with marketing experts to increase his skills.', 9),
(59, '2015-04-05 11:43:44', '2015-04-05 12:36:23', 'tyron.pretorius@hotmail.co.uk', 'pretorit', 'Tyron', 'Pretorius', NULL, '$2y$10$mlzK6eVFX/BMK62nL8s3j.m.0Z0QxvHfHmYdYHDjG68rqbtYb7MKm', 'I''m new to entrepreneurship but I''ve plenty of ideas! I have lots of project experience from my 3 years of engineering making an electronic buggy, a mangonel, a carboard shelter and most recently a fridge sensor. \r\nhttps://www.dropbox.com/s/pzykp7obbit64nf/3B8.wmv?dl=0 (Fridge Sensor)\r\nhttps://www.youtube.com/watch?v=dpff8Iz0y7w (Buggy Project from another group)\r\nhttps://www.youtube.com/watch?v=dpff8Iz0y7w (Shelter Project)\r\nhttps://www.youtube.com/watch?v=dpff8Iz0y7w (Mangonel)\r\n\r\nThese projects, especially the fridge sensor, have shown me how to go from an initial concept to a tangible, fully functioning prototype which is essential for entrepreneurship.', 'Currently in the Rubix team alongside me: a 3rd Year Computer Engineer and possibly a 3rd Year Electronic and Computer Engineer (yet to be confirmed). We''ve got all aspects of the engineering side covered but we are looking for a business and marketing guru.\r\nRequired experience:\r\n- Market Research + Estimating Market Size\r\n-Intellectual Property (Patenting, Trademarking , Licensing, Copyrighting)\r\n-Finance and Accounts (Sales Projection)\r\n-Advertising\r\n-Business Plans\r\n-Registering a Company\r\n\r\nWe''re a very passionate and enthusiastic team with lots of bright ideas! If you''re available towards the end of May or later and you want to see some of the things we''re working on, contact me via email: pretorit@tcd.ie ', 9),
(60, '2015-04-05 14:28:53', '2015-04-05 16:56:34', 'darraghmckay@gmail.com', 'mckay', 'Darragh', 'Mc Kay', 'xl5kU03f0Kclt4nrJ0MW4K2wwbdCdjfnCsR3vpKOr6RTgYEiWu7YoLpBcUse', '$2y$10$32thN.M5AKGsQdn7XKIu9uXnBKSs/Hw9KIplMijUZr2aOnld0IEtG', '', '', 5),
(61, '2015-04-06 07:54:19', '2015-04-07 10:32:35', 'amity.f@hotmail.com', 'Amfisher', 'Amity', 'Fisher', 'qm0GZ2TJeBk37tuFcpL7vkt18jc7nUEHio8l20T8UjDnqHb5FCPsWhDZfoWN', '$2y$10$UJW/w68MmTNreiObt1N61OqdiWUdrmnMhJxrMNzxsLO/VNI0J97f6', 'Strategic Planning Intern\r\nJWT Singapore \r\n\r\nAccounts: Nikon, Kellogg’s, Lux (Unilever)\r\nResponsibilities involved: \r\nSocial listening: Conducted social listening and major event reports that were cascaded to Nikon stakeholders across the Asian Pacific region. Completed further social listening for the Kellogg’s Masterbrand account.\r\n\r\nCompetitive analysis: Assisted with completion of Kellogg’s Asia Pacific competitor review used in other JWT offices in the APAC region. Conducted a premium product demonstration, which reviewed patterns in semiotics for \r\nlux \r\n\r\nConsumer, market and trend research: Researched Into beauty industry psychographics surrounding the TNS purple need state on behalf of Lux. Collected extensive research on global food and beverage trends for Kellogg’s.\r\n\r\nMasterbrand Development: Extensive work on the Lux global account assisting with the development of a brand concept idea. Conducted a content audit for Nikon that’s finding were used to develop both long-term and short- term digital engagement strategies.\r\n\r\n\r\n\r\nBrand Strategy Intern\r\nLove + Money \r\n\r\nAccounts: frank body scrub, A1 Office Fit outs & The Ark Clothing Co.\r\nThis position involved: \r\n\r\nBrand Strategy:  Developed sustainable brand ideas and brand values platforms. Conceptualized interplay between client service and marketing initiatives.\r\n\r\nResearch and market analysis: provided insight into brand positioning and assisted to define content territories and target audiences.\r\n\r\nMarketing: Assisted Love and Money with the development of specific client campaigns, marketing calendars, creative brief writing and the development of client presentations.\r\n\r\n\r\nVisual Merchandiser \r\nPVH Brands \r\nImplemented visual merchandising for: Calvin Klein Intimates, Calvin Klein jeans, Calvin Klein performance, Spanx & Nancy Ganz.\r\nTasks involved:\r\n\r\nStore profile reporting:Assisted with store profiling in order to provide Gazal with a better understanding of each stores consumer base and purchasing trends.\r\n\r\nStore and brand event organisation: Assisted with the organisation of key events held to educate Myer and David Jones staff on Gazal’s numerous brands.  \r\n\r\nStock analysis: Analysing stock levels and comparing stock positioning against sales reports in order to map key selling areas and increase sales.\r\n\r\n\r\n\r\nMarketing Strategy Intern \r\nAided the development of a concise brand strategy to solve both internal and external brand image problems.\r\n\r\nInternal:  Assisted with employee workshops and presentations to align brand understanding among stakeholders and employees.\r\n\r\nExternal: Assisted with copy writing and content creation for company publications and social media to synchronise new marketing initiatives.\r\n\r\n\r\nPublic Relations Intern \r\nI.D Collective (formally 360 Immerse)\r\nBlogger and media relations: Press releases, press kits, blogger relations and media relations. \r\n\r\nSocial media: Managing client social media pages, content creation & copy writing.\r\n', 'Like minded individuals who believe connecting true insights, social needs and  brand aspirations can solve business problems while benefiting society. ', 9),
